import React from 'react';

function FormComponent({ inputText, handleInputChange}) {
  return (
    <div>
        <form>
      <label>
        Add New Task:
        <input
          type="text"
          value={inputText}
          onChange={handleInputChange}
        />
      </label>
    </form>
    </div>
  );
}

export default FormComponent;
